%[text] # 1 ICESat-2 ATL03 Data Access
%[text] ## 1.1 Get coastal polygons
% define parameters
reso = 'c';
bbox = [-180 180; -60 66];
bufwidth = {3 .25}; % {outer inner} degrees
tol = 0.1; % degrees
min_area = 100; % km2

% specify query points manually to remove land polygons
% latq = [];
% lonq = [];
latq = [65.95 65.95 65.95 65.98];
lonq = [-174 -162 44 72];

% clip into 3 parts
% clip_lat = [];
clip_lat = [-27 27];
save_flag = false;

shapeoutC = make_coast_polygon(reso, bbox, bufwidth, tol, 'min_area', min_area, ... %[output:group:6a11cba6] %[output:8d6defd4]
                                                          'latq', latq, ... %[output:8d6defd4]
                                                          'lonq', lonq, ... %[output:8d6defd4]
                                                          'clip_lat', clip_lat, ... %[output:8d6defd4]
                                                          'save_flag', save_flag); %[output:group:6a11cba6] %[output:8d6defd4]
%%
%[text] ## 1.2 Download ICESat-2 ATL03 data
% using python script `download_icesat2.py`
%%
%[text] ## 1.3 Analyze ICESat-2 ATL03 data
% set parameters
oceanSegLen = 10.24; % [km]
depth_threshold = -10; % [m]
distance_threshold = 3; % [km]
version = '007';
%weight_threshold = 0.2; % for v006
weight_threshold = 0.03; % for v007
bufWin = 20; % [m]
interval = 5; % [m]
method = 'linear';
lackwidth = 20; % [m]
missing_threshold = 0.01;
psd_flag = false;
save_flag = false;

for year = 2018 %[output:group:456b9ba4]
    for month = 10
        datestr = sprintf('%04d%02d**', year, month);
        analyze_icesat2_ocean(datestr,  'oceanSegLen', oceanSegLen, ... %[output:22d8b336]
                                        'depth_threshold', depth_threshold, ... %[output:22d8b336]
                                        'distance_threshold', distance_threshold, ... %[output:22d8b336]
                                        'version', version, ... %[output:22d8b336]
                                        'weight_threshold', weight_threshold, ... %[output:22d8b336]
                                        'bufWin', bufWin, ... %[output:22d8b336]
                                        'interval', interval, ... %[output:22d8b336]
                                        'method', method, ... %[output:22d8b336]
                                        'lackwidth', lackwidth, ... %[output:22d8b336]
                                        'missing_threshold', missing_threshold, ... %[output:22d8b336]
                                        'psd_flag', psd_flag, ... %[output:22d8b336]
                                        'save_flag', save_flag); %[output:22d8b336]
    end
end %[output:group:456b9ba4]
%%
%[text] ## 1.4 Visualization
datestr = '201810';
version = '007';
save_flag = false;

TT = plot_is2_swh(datestr, version, save_flag); %[output:261fa094]
summary(TT); %[output:0d4e888d]

